import { makeStyles } from '@material-ui/core/styles'

export const useStyles = makeStyles(theme => ({
  root: {
    marginTop: theme.spacing(2)
  },
  imgCenter: {
    textAlign: 'center',
  },
  table: {
    minWidth: 700,
  },
  tableTitle: {
    color: '#fff',
    background: '#0057B8',
    font: 'Bold 31px/37px Arial;'
  }
}))
